    public class Solution
    {
        public int FindMaxLength(int[] nums)
        {
            var maxLength = 0;
            var currentLength = 0;
            var sum = 0;

            for (int i = 0; i < nums.Length; i++)
            {
                for (int j = i; j < nums.Length; j++)
                {
                    if (nums[j] == 0)
                    {
                        sum--;
                    }
                    else
                    {
                        sum++;
                    }

                    currentLength++;

                    if (sum == 0)
                    {
                        maxLength = Math.Max(maxLength, currentLength);
                    }
                }

                sum = 0;
                currentLength = 0;

                if ((nums.Length - i) < maxLength)
                {
                    break;
                }
            }

            return maxLength;
        }
    }
